// src/AdminExits.js
import React, { useState, useEffect } from 'react';
import './AdminExits.css';

function AdminExits({ userId }) {
  const [vehicles, setVehicles] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [error, setError] = useState('');
  const [exits, setExits] = useState([]);
  const [paymentMethod, setPaymentMethod] = useState('kart');

  // ✅ Araçları ve çıkışları çekme
  const fetchVehicles = async () => {
    try {
      const response = await fetch('/api/giris');
      if (!response.ok) throw new Error('Araçlar alınamadı.');
      const data = await response.json();
      const filteredData = data.filter((entry) => entry.cikis_durumu === 'çıkmadı');
      setVehicles(filteredData);
    } catch (err) {
      console.error('Araçlar çekilirken hata:', err);
      setError('Araçlar çekilirken bir hata oluştu.');
    }
  };

  const fetchExits = async () => {
    try {
      const response = await fetch('/api/cikis');
      if (!response.ok) throw new Error('Çıkış kayıtları alınamadı.');
      const data = await response.json();
      setExits(data);
    } catch (err) {
      console.error('Çıkış kayıtları çekilirken hata:', err);
      setError('Çıkış kayıtları çekilirken bir hata oluştu.');
    }
  };

  useEffect(() => {
    fetchVehicles();
    fetchExits();
  }, []);

  // ✅ Araç Çıkışı
  const handleExit = async (giris_ID, arac_plaka, yer_ID) => {
    if (!paymentMethod) {
      return alert('Lütfen ödeme yöntemi seçiniz.');
    }

    try {
      const response = await fetch('/api/cikis', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          giris_ID,
          arac_plaka,
          odeme_yontemi: paymentMethod,
        }),
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Çıkış işlemi yapılamadı.');
      }

      alert('Çıkış işlemi başarılı.');
      fetchVehicles();
      fetchExits();
    } catch (err) {
      console.error('Çıkış işlemi sırasında hata:', err);
      setError(err.message);
    }
  };

  const filteredVehicles = vehicles.filter((vehicle) =>
    vehicle.arac_plaka.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="admin-exits-container">
      {/* Sol Panel: Otoparktaki Araçlar */}
      <div className="left-panel">
        <h2>Otoparktaki Araçlar</h2>
        <input
          type="text"
          placeholder="Plaka Ara..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <label>Ödeme Yöntemi:
          <select value={paymentMethod} onChange={(e) => setPaymentMethod(e.target.value)}>
            <option value="kart">Kart</option>
            <option value="nakit">Nakit</option>
          </select>
        </label>
        {error && <div className="error">{error}</div>}

        <table className="vehicles-table">
          <thead>
            <tr>
              <th>Plaka</th>
              <th>Giriş Saati</th>
              <th>Park Alanı</th>
              <th>Çıkış</th>
            </tr>
          </thead>
          <tbody>
            {filteredVehicles.map((vehicle) => (
              <tr key={vehicle.giris_ID}>
                <td>{vehicle.arac_plaka}</td>
                <td>{new Date(vehicle.giris_saat).toLocaleString()}</td>
                <td>{vehicle.yer_ad}</td>
                <td>
                  <button onClick={() => handleExit(vehicle.giris_ID, vehicle.arac_plaka, vehicle.yer_ID)}>
                    Çıkış Yap
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Sağ Panel: Çıkış Yapan Araçlar */}
      <div className="right-panel">
        <h2>Çıkış Yapan Araçlar</h2>
        <table className="exits-table">
          <thead>
            <tr>
              <th>Plaka</th>
              <th>Giriş Saati</th>
              <th>Çıkış Saati</th>
              <th>Ödeme Yöntemi</th>
              <th>Ücret</th>
            </tr>
          </thead>
          <tbody>
            {exits.map((exit) => (
              <tr key={exit.cikis_ID}>
                <td>{exit.arac_plaka}</td>
                <td>{new Date(exit.giris_saat).toLocaleString()}</td>
                <td>{new Date(exit.cikis_saati).toLocaleString()}</td>
                <td>{exit.odeme_yontemi}</td>
                <td>{exit.ucret} TL</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default AdminExits;
